int_rules_8_1 = @theory begin

#= ::Subsection::Closed:: =#
#= 8.1 Error functions =#
Int(Erf(a_' + b_'*x_), x_Symbol) := ((a + b*x)*Erf(a + b*x)/b + 1/(b*Sqrt(pi)*ℯ^(a + b*x)^2) <-- FreeQ([a, b], x))
Int(Erfc(a_' + b_'*x_), x_Symbol) := ((a + b*x)*Erfc(a + b*x)/b - 1/(b*Sqrt(pi)*ℯ^(a + b*x)^2) <-- FreeQ([a, b], x))
Int(Erfi(a_' + b_'*x_), x_Symbol) := ((a + b*x)*Erfi(a + b*x)/b - ℯ^(a + b*x)^2/(b*Sqrt(pi)) <-- FreeQ([a, b], x))
Int(Erf(a_' + b_'*x_)^2, x_Symbol) := ((a + b*x)*Erf(a + b*x)^2/b - 4/Sqrt(pi)*Int((a + b*x)*Erf(a + b*x)/ℯ^(a + b*x)^2, x) <-- FreeQ([a, b], x))
Int(Erfc(a_' + b_'*x_)^2, x_Symbol) := ((a + b*x)*Erfc(a + b*x)^2/b + 4/Sqrt(pi)*Int((a + b*x)*Erfc(a + b*x)/ℯ^(a + b*x)^2, x) <-- FreeQ([a, b], x))
Int(Erfi(a_' + b_'*x_)^2, x_Symbol) := ((a + b*x)*Erfi(a + b*x)^2/b - 4/Sqrt(pi)*Int((a + b*x)*ℯ^(a + b*x)^2*Erfi(a + b*x), x) <-- FreeQ([a, b], x))
Int(Erf(a_' + b_'*x_)^n_, x_Symbol) := (Unintegrable(Erf(a + b*x)^n, x) <-- FreeQ([a, b, n], x) && NeQ(n, 1) && NeQ(n, 2))
Int(Erfc(a_' + b_'*x_)^n_, x_Symbol) := (Unintegrable(Erfc(a + b*x)^n, x) <-- FreeQ([a, b, n], x) && NeQ(n, 1) && NeQ(n, 2))
Int(Erfi(a_' + b_'*x_)^n_, x_Symbol) := (Unintegrable(Erfi(a + b*x)^n, x) <-- FreeQ([a, b, n], x) && NeQ(n, 1) && NeQ(n, 2))
Int(Erf(b_'*x_)/x_, x_Symbol) := (2*b*x/Sqrt(pi)*HypergeometricPFQ([1/2, 1/2], [3/2, 3/2], -b^2*x^2) <-- FreeQ(b, x))
Int(Erfc(b_'*x_)/x_, x_Symbol) := (Log(x) - Int(Erf(b*x)/x, x) <-- FreeQ(b, x))
Int(Erfi(b_'*x_)/x_, x_Symbol) := (2*b*x/Sqrt(pi)*HypergeometricPFQ([1/2, 1/2], [3/2, 3/2], b^2*x^2) <-- FreeQ(b, x))
Int((c_' + d_'*x_)^m_'*Erf(a_' + b_'*x_), x_Symbol) := ((c + d*x)^(m + 1)*Erf(a + b*x)/(d*(m + 1)) - 2*b/(Sqrt(pi)*d*(m + 1))* Int((c + d*x)^(m + 1)/ℯ^(a + b*x)^2, x) <-- FreeQ([a, b, c, d, m], x) && NeQ(m, -1))
Int((c_' + d_'*x_)^m_'*Erfc(a_' + b_'*x_), x_Symbol) := ((c + d*x)^(m + 1)*Erfc(a + b*x)/(d*(m + 1)) + 2*b/(Sqrt(pi)*d*(m + 1))* Int((c + d*x)^(m + 1)/ℯ^(a + b*x)^2, x) <-- FreeQ([a, b, c, d, m], x) && NeQ(m, -1))
Int((c_' + d_'*x_)^m_'*Erfi(a_' + b_'*x_), x_Symbol) := ((c + d*x)^(m + 1)*Erfi(a + b*x)/(d*(m + 1)) - 2*b/(Sqrt(pi)*d*(m + 1))* Int((c + d*x)^(m + 1)*ℯ^(a + b*x)^2, x) <-- FreeQ([a, b, c, d, m], x) && NeQ(m, -1))
Int(x_^m_'*Erf(b_'*x_)^2, x_Symbol) := (x^(m + 1)*Erf(b*x)^2/(m + 1) - 4*b/(Sqrt(pi)*(m + 1))*Int(x^(m + 1)*ℯ^(-b^2*x^2)*Erf(b*x), x) <-- FreeQ(b, x) && (IGtQ(m, 0) || ILtQ((m + 1)/2, 0)))
Int(x_^m_'*Erfc(b_'*x_)^2, x_Symbol) := (x^(m + 1)*Erfc(b*x)^2/(m + 1) + 4*b/(Sqrt(pi)*(m + 1))*Int(x^(m + 1)*ℯ^(-b^2*x^2)*Erfc(b*x), x) <-- FreeQ(b, x) && (IGtQ(m, 0) || ILtQ((m + 1)/2, 0)))
Int(x_^m_'*Erfi(b_'*x_)^2, x_Symbol) := (x^(m + 1)*Erfi(b*x)^2/(m + 1) - 4*b/(Sqrt(pi)*(m + 1))*Int(x^(m + 1)*ℯ^(b^2*x^2)*Erfi(b*x), x) <-- FreeQ(b, x) && (IGtQ(m, 0) || ILtQ((m + 1)/2, 0)))
Int((c_' + d_'*x_)^m_'*Erf(a_ + b_'*x_)^2, x_Symbol) := (1/b^(m + 1)* Subst(Int(ExpandIntegrand(Erf(x)^2, (b*c - a*d + d*x)^m, x), x), x, a + b*x) <-- FreeQ([a, b, c, d], x) && IGtQ(m, 0))
Int((c_' + d_'*x_)^m_'*Erfc(a_ + b_'*x_)^2, x_Symbol) := (1/b^(m + 1)* Subst(Int(ExpandIntegrand(Erfc(x)^2, (b*c - a*d + d*x)^m, x), x), x, a + b*x) <-- FreeQ([a, b, c, d], x) && IGtQ(m, 0))
Int((c_' + d_'*x_)^m_'*Erfi(a_ + b_'*x_)^2, x_Symbol) := (1/b^(m + 1)* Subst(Int(ExpandIntegrand(Erfi(x)^2, (b*c - a*d + d*x)^m, x), x), x, a + b*x) <-- FreeQ([a, b, c, d], x) && IGtQ(m, 0))
Int((c_' + d_'*x_)^m_'*Erf(a_' + b_'*x_)^n_', x_Symbol) := (Unintegrable((c + d*x)^m*Erf(a + b*x)^n, x) <-- FreeQ([a, b, c, d, m, n], x))
Int((c_' + d_'*x_)^m_'*Erfc(a_' + b_'*x_)^n_', x_Symbol) := (Unintegrable((c + d*x)^m*Erfc(a + b*x)^n, x) <-- FreeQ([a, b, c, d, m, n], x))
Int((c_' + d_'*x_)^m_'*Erfi(a_' + b_'*x_)^n_', x_Symbol) := (Unintegrable((c + d*x)^m*Erfi(a + b*x)^n, x) <-- FreeQ([a, b, c, d, m, n], x))
Int(ℯ^(c_' + d_'*x_^2)*Erf(b_'*x_)^n_', x_Symbol) := (ℯ^c*Sqrt(pi)/(2*b)*Subst(Int(x^n, x), x, Erf(b*x)) <-- FreeQ([b, c, d, n], x) && EqQ(d, -b^2))
Int(ℯ^(c_' + d_'*x_^2)*Erfc(b_'*x_)^n_', x_Symbol) := (-ℯ^c*Sqrt(pi)/(2*b)* Subst(Int(x^n, x), x, Erfc(b*x)) <-- FreeQ([b, c, d, n], x) && EqQ(d, -b^2))
Int(ℯ^(c_' + d_'*x_^2)*Erfi(b_'*x_)^n_', x_Symbol) := (ℯ^c*Sqrt(pi)/(2*b)*Subst(Int(x^n, x), x, Erfi(b*x)) <-- FreeQ([b, c, d, n], x) && EqQ(d, b^2))
Int(ℯ^(c_' + d_'*x_^2)*Erf(b_'*x_), x_Symbol) := (b*ℯ^c*x^2/Sqrt(pi)*HypergeometricPFQ([1, 1], [3/2, 2], b^2*x^2) <-- FreeQ([b, c, d], x) && EqQ(d, b^2))
Int(ℯ^(c_' + d_'*x_^2)*Erfc(b_'*x_), x_Symbol) := (Int(ℯ^(c + d*x^2), x) - Int(ℯ^(c + d*x^2)*Erf(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d, b^2))
Int(ℯ^(c_' + d_'*x_^2)*Erfi(b_'*x_), x_Symbol) := (b*ℯ^c*x^2/Sqrt(pi)*HypergeometricPFQ([1, 1], [3/2, 2], -b^2*x^2) <-- FreeQ([b, c, d], x) && EqQ(d, -b^2))
Int(ℯ^(c_' + d_'*x_^2)*Erf(a_' + b_'*x_)^n_', x_Symbol) := (Unintegrable(ℯ^(c + d*x^2)*Erf(a + b*x)^n, x) <-- FreeQ([a, b, c, d, n], x))
Int(ℯ^(c_' + d_'*x_^2)*Erfc(a_' + b_'*x_)^n_', x_Symbol) := (Unintegrable(ℯ^(c + d*x^2)*Erfc(a + b*x)^n, x) <-- FreeQ([a, b, c, d, n], x))
Int(ℯ^(c_' + d_'*x_^2)*Erfi(a_' + b_'*x_)^n_', x_Symbol) := (Unintegrable(ℯ^(c + d*x^2)*Erfi(a + b*x)^n, x) <-- FreeQ([a, b, c, d, n], x))
Int(x_*ℯ^(c_' + d_'*x_^2)*Erf(a_' + b_'*x_), x_Symbol) := (ℯ^(c + d*x^2)*Erf(a + b*x)/(2*d) - b/(d*Sqrt(pi))*Int(ℯ^(-a^2 + c - 2*a*b*x - (b^2 - d)*x^2), x) <-- FreeQ([a, b, c, d], x))
Int(x_*ℯ^(c_' + d_'*x_^2)*Erfc(a_' + b_'*x_), x_Symbol) := (ℯ^(c + d*x^2)*Erfc(a + b*x)/(2*d) + b/(d*Sqrt(pi))*Int(ℯ^(-a^2 + c - 2*a*b*x - (b^2 - d)*x^2), x) <-- FreeQ([a, b, c, d], x))
Int(x_*ℯ^(c_' + d_'*x_^2)*Erfi(a_' + b_'*x_), x_Symbol) := (ℯ^(c + d*x^2)*Erfi(a + b*x)/(2*d) - b/(d*Sqrt(pi))*Int(ℯ^(a^2 + c + 2*a*b*x + (b^2 + d)*x^2), x) <-- FreeQ([a, b, c, d], x))
Int(x_^m_*ℯ^(c_' + d_'*x_^2)*Erf(a_' + b_'*x_), x_Symbol) := (x^(m - 1)*ℯ^(c + d*x^2)*Erf(a + b*x)/(2*d) - b/(d*Sqrt(pi))* Int(x^(m - 1)*ℯ^(-a^2 + c - 2*a*b*x - (b^2 - d)*x^2), x) - (m - 1)/(2*d)*Int(x^(m - 2)*ℯ^(c + d*x^2)*Erf(a + b*x), x) <-- FreeQ([a, b, c, d], x) && IGtQ(m, 1))
Int(x_^m_*ℯ^(c_' + d_'*x_^2)*Erfc(a_' + b_'*x_), x_Symbol) := (x^(m - 1)*ℯ^(c + d*x^2)*Erfc(a + b*x)/(2*d) + b/(d*Sqrt(pi))* Int(x^(m - 1)*ℯ^(-a^2 + c - 2*a*b*x - (b^2 - d)*x^2), x) - (m - 1)/(2*d)*Int(x^(m - 2)*ℯ^(c + d*x^2)*Erfc(a + b*x), x) <-- FreeQ([a, b, c, d], x) && IGtQ(m, 1))
Int(x_^m_*ℯ^(c_' + d_'*x_^2)*Erfi(a_' + b_'*x_), x_Symbol) := (x^(m - 1)*ℯ^(c + d*x^2)*Erfi(a + b*x)/(2*d) - b/(d*Sqrt(pi))* Int(x^(m - 1)*ℯ^(a^2 + c + 2*a*b*x + (b^2 + d)*x^2), x) - (m - 1)/(2*d)*Int(x^(m - 2)*ℯ^(c + d*x^2)*Erfi(a + b*x), x) <-- FreeQ([a, b, c, d], x) && IGtQ(m, 1))
Int(ℯ^(c_' + d_'*x_^2)*Erf(b_'*x_)/x_, x_Symbol) := (2*b*ℯ^c*x/Sqrt(pi)*HypergeometricPFQ([1/2, 1], [3/2, 3/2], b^2*x^2) <-- FreeQ([b, c, d], x) && EqQ(d, b^2))
Int(ℯ^(c_' + d_'*x_^2)*Erfc(b_'*x_)/x_, x_Symbol) := (Int(ℯ^(c + d*x^2)/x, x) - Int(ℯ^(c + d*x^2)*Erf(b*x)/x, x) <-- FreeQ([b, c, d], x) && EqQ(d, b^2))
Int(ℯ^(c_' + d_'*x_^2)*Erfi(b_'*x_)/x_, x_Symbol) := (2*b*ℯ^c*x/Sqrt(pi)* HypergeometricPFQ([1/2, 1], [3/2, 3/2], -b^2*x^2) <-- FreeQ([b, c, d], x) && EqQ(d, -b^2))
Int(x_^m_*ℯ^(c_' + d_'*x_^2)*Erf(a_' + b_'*x_), x_Symbol) := (x^(m + 1)*ℯ^(c + d*x^2)*Erf(a + b*x)/(m + 1) - 2*b/((m + 1)*Sqrt(pi))* Int(x^(m + 1)*ℯ^(-a^2 + c - 2*a*b*x - (b^2 - d)*x^2), x) - 2*d/(m + 1)*Int(x^(m + 2)*ℯ^(c + d*x^2)*Erf(a + b*x), x) <-- FreeQ([a, b, c, d], x) && ILtQ(m, -1))
Int(x_^m_*ℯ^(c_' + d_'*x_^2)*Erfc(a_' + b_'*x_), x_Symbol) := (x^(m + 1)*ℯ^(c + d*x^2)*Erfc(a + b*x)/(m + 1) + 2*b/((m + 1)*Sqrt(pi))* Int(x^(m + 1)*ℯ^(-a^2 + c - 2*a*b*x - (b^2 - d)*x^2), x) - 2*d/(m + 1)*Int(x^(m + 2)*ℯ^(c + d*x^2)*Erfc(a + b*x), x) <-- FreeQ([a, b, c, d], x) && ILtQ(m, -1))
Int(x_^m_*ℯ^(c_' + d_'*x_^2)*Erfi(a_' + b_'*x_), x_Symbol) := (x^(m + 1)*ℯ^(c + d*x^2)*Erfi(a + b*x)/(m + 1) - 2*b/((m + 1)*Sqrt(pi))* Int(x^(m + 1)*ℯ^(a^2 + c + 2*a*b*x + (b^2 + d)*x^2), x) - 2*d/(m + 1)*Int(x^(m + 2)*ℯ^(c + d*x^2)*Erfi(a + b*x), x) <-- FreeQ([a, b, c, d], x) && ILtQ(m, -1))
Int((e_'*x_)^m_'*ℯ^(c_' + d_'*x_^2)*Erf(a_' + b_'*x_)^n_', x_Symbol) := (Unintegrable((e*x)^m*ℯ^(c + d*x^2)*Erf(a + b*x)^n, x) <-- FreeQ([a, b, c, d, e, m, n], x))
Int((e_'*x_)^m_'*ℯ^(c_' + d_'*x_^2)*Erfc(a_' + b_'*x_)^n_', x_Symbol) := (Unintegrable((e*x)^m*ℯ^(c + d*x^2)*Erfc(a + b*x)^n, x) <-- FreeQ([a, b, c, d, e, m, n], x))
Int((e_'*x_)^m_'*ℯ^(c_' + d_'*x_^2)*Erfi(a_' + b_'*x_)^n_', x_Symbol) := (Unintegrable((e*x)^m*ℯ^(c + d*x^2)*Erfi(a + b*x)^n, x) <-- FreeQ([a, b, c, d, e, m, n], x))
Int(Erf(d_'*(a_' + b_'*Log(c_'*x_^n_'))), x_Symbol) := (x*Erf(d*(a + b*Log(c*x^n))) - 2*b*d*n/(Sqrt(pi))*Int(1/ℯ^(d*(a + b*Log(c*x^n)))^2, x) <-- FreeQ([a, b, c, d, n], x))
Int(Erfc(d_'*(a_' + b_'*Log(c_'*x_^n_'))), x_Symbol) := (x*Erfc(d*(a + b*Log(c*x^n))) + 2*b*d*n/(Sqrt(pi))*Int(1/ℯ^(d*(a + b*Log(c*x^n)))^2, x) <-- FreeQ([a, b, c, d, n], x))
Int(Erfi(d_'*(a_' + b_'*Log(c_'*x_^n_'))), x_Symbol) := (x*Erfi(d*(a + b*Log(c*x^n))) - 2*b*d*n/(Sqrt(pi))*Int(ℯ^(d*(a + b*Log(c*x^n)))^2, x) <-- FreeQ([a, b, c, d, n], x))
Int(F_(d_'*(a_' + b_'*Log(c_'*x_^n_')))/x_, x_Symbol) := (1/n*Subst(F(d*(a + b*x)), x, Log(c*x^n)) <-- FreeQ([a, b, c, d, n], x) && MemberQ([Erf, Erfc, Erfi], F))
Int((e_'*x_)^m_'*Erf(d_'*(a_' + b_'*Log(c_'*x_^n_'))), x_Symbol) := ((e*x)^(m + 1)* Erf(d*(a + b*Log(c*x^n)))/(e*(m + 1)) - 2*b*d*n/(Sqrt(pi)*(m + 1))* Int((e*x)^m/ℯ^(d*(a + b*Log(c*x^n)))^2, x) <-- FreeQ([a, b, c, d, e, m, n], x) && NeQ(m, -1))
Int((e_'*x_)^m_'*Erfc(d_'*(a_' + b_'*Log(c_'*x_^n_'))), x_Symbol) := ((e*x)^(m + 1)* Erfc(d*(a + b*Log(c*x^n)))/(e*(m + 1)) + 2*b*d*n/(Sqrt(pi)*(m + 1))* Int((e*x)^m/ℯ^(d*(a + b*Log(c*x^n)))^2, x) <-- FreeQ([a, b, c, d, e, m, n], x) && NeQ(m, -1))
Int((e_'*x_)^m_'*Erfi(d_'*(a_' + b_'*Log(c_'*x_^n_'))), x_Symbol) := ((e*x)^(m + 1)* Erfi(d*(a + b*Log(c*x^n)))/(e*(m + 1)) - 2*b*d*n/(Sqrt(pi)*(m + 1))* Int((e*x)^m*ℯ^(d*(a + b*Log(c*x^n)))^2, x) <-- FreeQ([a, b, c, d, e, m, n], x) && NeQ(m, -1))
Int(Sin(c_' + d_'*x_^2)*Erf(b_'*x_), x_Symbol) := (im/2*Int(ℯ^(-im*c - im*d*x^2)*Erf(b*x), x) - im/2*Int(ℯ^(im*c + im*d*x^2)*Erf(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, -b^4))
Int(Sin(c_' + d_'*x_^2)*Erfc(b_'*x_), x_Symbol) := (im/2*Int(ℯ^(-im*c - im*d*x^2)*Erfc(b*x), x) - im/2*Int(ℯ^(im*c + im*d*x^2)*Erfc(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, -b^4))
Int(Sin(c_' + d_'*x_^2)*Erfi(b_'*x_), x_Symbol) := (im/2*Int(ℯ^(-im*c - im*d*x^2)*Erfi(b*x), x) - im/2*Int(ℯ^(im*c + im*d*x^2)*Erfi(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, -b^4))
Int(Cos(c_' + d_'*x_^2)*Erf(b_'*x_), x_Symbol) := (1/2*Int(ℯ^(-im*c - im*d*x^2)*Erf(b*x), x) + 1/2*Int(ℯ^(im*c + im*d*x^2)*Erf(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, -b^4))
Int(Cos(c_' + d_'*x_^2)*Erfc(b_'*x_), x_Symbol) := (1/2*Int(ℯ^(-im*c - im*d*x^2)*Erfc(b*x), x) + 1/2*Int(ℯ^(im*c + im*d*x^2)*Erfc(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, -b^4))
Int(Cos(c_' + d_'*x_^2)*Erfi(b_'*x_), x_Symbol) := (1/2*Int(ℯ^(-im*c - im*d*x^2)*Erfi(b*x), x) + 1/2*Int(ℯ^(im*c + im*d*x^2)*Erfi(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, -b^4))
Int(Sinh(c_' + d_'*x_^2)*Erf(b_'*x_), x_Symbol) := (1/2*Int(ℯ^(c + d*x^2)*Erf(b*x), x) - 1/2*Int(ℯ^(-c - d*x^2)*Erf(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, b^4))
Int(Sinh(c_' + d_'*x_^2)*Erfc(b_'*x_), x_Symbol) := (1/2*Int(ℯ^(c + d*x^2)*Erfc(b*x), x) - 1/2*Int(ℯ^(-c - d*x^2)*Erfc(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, b^4))
Int(Sinh(c_' + d_'*x_^2)*Erfi(b_'*x_), x_Symbol) := (1/2*Int(ℯ^(c + d*x^2)*Erfi(b*x), x) - 1/2*Int(ℯ^(-c - d*x^2)*Erfi(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, b^4))
Int(Cosh(c_' + d_'*x_^2)*Erf(b_'*x_), x_Symbol) := (1/2*Int(ℯ^(c + d*x^2)*Erf(b*x), x) + 1/2*Int(ℯ^(-c - d*x^2)*Erf(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, b^4))
Int(Cosh(c_' + d_'*x_^2)*Erfc(b_'*x_), x_Symbol) := (1/2*Int(ℯ^(c + d*x^2)*Erfc(b*x), x) + 1/2*Int(ℯ^(-c - d*x^2)*Erfc(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, b^4))
Int(Cosh(c_' + d_'*x_^2)*Erfi(b_'*x_), x_Symbol) := (1/2*Int(ℯ^(c + d*x^2)*Erfi(b*x), x) + 1/2*Int(ℯ^(-c - d*x^2)*Erfi(b*x), x) <-- FreeQ([b, c, d], x) && EqQ(d^2, b^4))
Int(F_(f_'*(a_' + b_'*Log(c_'*(d_ + e_'*x_)^n_'))), x_Symbol) := (1/e*Subst(Int(F(f*(a + b*Log(c*x^n))), x), x, d + e*x) <-- FreeQ([a, b, c, d, e, f, n], x) && MemberQ([Erf, Erfc, Erfi, FresnelS, FresnelC, ExpIntegralEi, SinIntegral, CosIntegral, SinhIntegral, CoshIntegral], F))
Int((g_ + h_'*x_)^m_'*F_(f_'*(a_' + b_'*Log(c_'*(d_ + e_'*x_)^n_'))), x_Symbol) := (1/e*Subst(Int((g*x/d)^m*F(f*(a + b*Log(c*x^n))), x), x, d + e*x) <-- FreeQ([a, b, c, d, e, f, g, m, n], x) && EqQ(e*f - d*g, 0) && MemberQ([Erf, Erfc, Erfi, FresnelS, FresnelC, ExpIntegralEi, SinIntegral, CosIntegral, SinhIntegral, CoshIntegral], F))
end
